import Info from './components/Info';
import Wire from './components/Wire'

const rootStyle = {
  position: 'absolute',
  display: 'inline-block',
  height: '100vh',
  width: '100vw',
}

const canvasStyle = {
  // position: 'absolute',
}

const infoStyle = {
  position: 'absolute',
  left: '1em',
  top: '1em',
}


function App() {

  return (
    <div style={rootStyle}>
          <Canvas style={canvasStyle}>
            <Wire />
          </Canvas>
          <Info style={infoStyle} />
    </div>
  );
}

export default App;
